import "./App.css";
import logo from "./assets/logo.png";
import people from "./assets/happytable.jpg";
import people2 from "./assets/people2.jpg";
import fish from "./assets/fish.jpg";
import SimpleImageSlider from "react-simple-image-slider";
import wa from "./assets/whatsapp.png";
import phone from "./assets/phone.png";
import location from "./assets/location.png";
import menu from "./assets/menu.jpg";

function App() {
  const MenuItem = ({ title }) => {
    return (
      <div
        style={{
          fontSize: 16,
          color: "#fff",
          fontWeight: "bold",
          fontFamily: "monospace",
        }}
      >
        {title}
      </div>
    );
  };
  return (
    <div className="App" style={{ height: "100vh", width: "100vw" }}>
      {/* header */}
      <div
        style={{
          width: "100%",
          display: "flex",
          flexDirection: "row",
          alignItems: "center",
        }}
      >
        <img src={logo} style={{ height: 80, width: 80, margin: 20 }} />
        <div
          style={{
            color: "#fff",
            fontWeight: "bold",
            fontSize: 30,
            fontFamily: "cursive",
          }}
        >
          Red Fish
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            flex: 1,
            height: 50,
            alignItems: "center",
            justifyContent: "flex-end",
            columnGap: 35,
            marginRight: 40,
            cursor: "pointer",
          }}
        >
          <MenuItem title="HOME" />
          <MenuItem title="ABOUT" />
          <MenuItem title="MENU" />
          <MenuItem title="CONTACTS" />
        </div>
      </div>
      {/* header end */}

      {/* body */}
      <div
        style={{
          width: "100%",
          flexDirection: "column",
          display: "flex",
          // marginTop: 80,
          justifyContent: "center",
        }}
      >
        <div
          style={{
            width: "100%",
            flexDirection: "row",
            display: "flex",
            marginTop: 80,
            justifyContent: "space-between",
          }}
        >
          <div style={{ marginLeft: 120 }}>
            <div style={{ fontWeight: "bold", fontSize: 60, color: "#fff" }}>
              Lorem ipsum dolor
            </div>
            <div style={{ fontWeight: "bold", fontSize: 40, color: "#fff" }}>
              sit amet
            </div>

            <div
              style={{
                fontWeight: "400",
                fontSize: 14,
                color: "#fff",
                maxWidth: 400,
                marginTop: 30,
              }}
            >
              consectetur adipiscing elit. Nullam at enim eget dui lobortis
              tempor. Nulla bibendum convallis urna a bibendum. Curabitur sem
              lectus
            </div>

            <div
              style={{
                height: 70,
                width: 400,
                borderRadius: 10,
                display: "flex",
                // backgroundColor: "#e6b515",
                marginTop: 50,
                alignItems: "center",
                // justifyContent: "center",
                color: "#000",
                // fontWeight: "bold",
                cursor: "pointer",
              }}
            >
              <input
                style={{
                  display: "flex",
                  height: 45,
                  width: 250,
                  borderRadius: 8,
                  fontWeight: "bold",
                }}
                placeholder="Insert your Email"
              />
              <div
                style={{
                  height: 50,
                  width: 150,
                  borderRadius: 10,
                  display: "flex",
                  backgroundColor: "#e6b515",
                  // marginTop: 50,
                  marginLeft: 10,
                  alignItems: "center",
                  justifyContent: "center",
                  color: "#000",
                  fontWeight: "bold",
                  cursor: "pointer",
                }}
              >
                BOOK A TABLE
              </div>
            </div>
          </div>

          <div style={{ height: 450, width: 700, marginRight: 120 }}>
            <SimpleImageSlider
              width={700}
              height={450}
              images={[fish, people, people2]}
              showBullets={true}
              showNavs={true}
              loop
              autoPlay
              autoPlayDelay={4}
            />
          </div>
          {/* <div
          style={{
            width: "100%",
            height: 60,
            position: "absolute",
            bottom: 0,
            display: "flex",
            flexDirection: "row",
            columnGap: 30,
          }}
        >
          <img src={wa} style={{ height: 30, width: 30, marginLeft: 30 }} />
          <img src={phone} style={{ height: 30, width: 30 }} />
          <img src={location} style={{ height: 30, width: 30 }} />
        </div> */}
        </div>
        <div
          style={{
            width: "100%",
            height: 2,
            marginTop: 90,
            justifyContent: "center",
            alignItems: "center",
            display: "flex",
          }}
        >
          <div
            style={{
              backgroundColor: "#e6b515",
              width: "90%",
              height: "100%",
            }}
          ></div>
        </div>
        <div
          style={{
            display: "flex",
            width: "100%",
            marginTop: 50,
            flexDirection: "column",
            backgroundColor: "#000",
            alignItems: "center",
          }}
          id="items"
        >
          {/* row  */}
          <div style={{ display: "flex", flexDirection: "row", width: "80%" }}>
            <div style={{ display: "flex", flex: 1, backgroundColor: "#fff" }}>
              <img height="300" width="400" src={menu} />
            </div>
          </div>
        </div>
      </div>
      {/* body end */}
      {/* line */}
    </div>
  );
}

export default App;
